import React, { Component } from 'react'

export default class Price extends Component {
  render(){
    const { prod } = this.props
    return (
      <React.Fragment>
        <span itemProp="price">{prod.price}</span>
        <span itemProp="priceCurrency">{prod.currency}</span>
      </React.Fragment>
    )
  }
}
